class CardColors {
    blue : string = "#264653"
    green : string = "#2a9d8f"
    red : string = "#e76f51"
    yellow : string = "#e9c46a"
}


export const cardColors =  new CardColors()


class UIColors {
    verylight : string = "#f2f2f2"
    light : string = "#cccccc"
    medium : string = "#a5a5a5"
    dark : string = "#7f7f7f"
    verydark : string = "#595959"
    active : string = "#f4a261"
}

export const uiColors = new UIColors()
